    </div>
  );
}

function exampleCa() {
  return (
    <>
      <div className="intro">
        <h1>Welcome to my website: Cook with Cats!</h1>
      </div>
      <p className="summary">
        You can find my Recipes here.
        <br />
        <br />
        <b>
          {" "}
          And <i>pictures</i>
        </b>
        of Cats!
      </p>
    </>
  );
}

function Recap() {
  return (
    <>
      <h4>Recap from reactjs.org</h4>
      <p>
